import { Card, CardHeader, CardMedia, Grid, GridList, GridListTile, makeStyles, Typography } from '@material-ui/core';
import React from 'react';
import AppContent from '../Content/AppContent';
import AppbarGeneric from '../Generics/AppbarGeneric';
import clsx from 'clsx';
import { AccountCircleOutlined } from '@material-ui/icons';
import './ProfilePageStyles.css';

const useStyles = makeStyles((theme) => ({
    content: {
        justifyContent:"center",
        alignItems:"flex-start",
        overflowX: "hidden",
        spacing: 10
    },
    tile: {
        border: "1px solid black"
    },
    avatar: {
        justifyContent:"center",
        alignItems:"center",
        fontSize: 60,
        backgroundColor: 'yellow'
    },
    cardCategoryWhite: {
        color: "rgba(255,255,255,.62)",
        margin: "0",
        fontSize: "14px",
        marginTop: "0",
        marginBottom: "0"
      },
      cardAvatar: {
        justifyContent:"center",
        alignItems:"center",
        color: "#FFFFFF",
        marginTop: "0px",
        minHeight: "auto",
        fontWeight: 300,
        fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
        marginBottom: "3px",
        textDecoration: "none",
        maxWidth: 250
      }
}));


const ProfilePage: React.FC = () => {

    const styles = useStyles();

    return(
        <React.Fragment>
        <AppbarGeneric />
            <AppContent>
            <div style={{margin:0, padding:20}}>
                <GridList cols={2} className={styles.content}>
                    <GridListTile className="tile">
                        {/* <AccountCircleOutlined className={styles.avatar} /> */}
                        <Card className="cardAvatar">
                            <CardHeader className={styles.avatar} color="red" avatar={<AccountCircleOutlined className={styles.avatar} />}>
                                <h4 >Edit Profile</h4>
                                <p >Complete your profile</p>
                            </CardHeader>
                        </Card>
                    </GridListTile>
                    <GridList cols={1}>
                        <GridListTile style={{backgroundColor: 'green', height: '50px'}} className={styles.tile}>
                        <Typography>
                            NAME AND SETTINGS
                        </Typography>
                        </GridListTile>
                        <GridListTile style={{backgroundColor: 'green', height: '50px'}} className={styles.tile}>
                        <Typography>
                            PURSES
                        </Typography>
                        </GridListTile>
                        <GridListTile style={{backgroundColor: 'green', height: '50px'}} className={styles.tile}>
                        <Typography>
                            ANOTHER INTORMATION
                        </Typography>
                        </GridListTile>
                    </GridList>
                    <GridListTile style={{backgroundColor: 'green', height: '50px'}} className={styles.tile}>

                    </GridListTile>
                </GridList>
            </div>
        </AppContent>
        </React.Fragment>
    );
}

export default ProfilePage;
